import React, {Component} from "react";
import Page from '../components/Page';
import TrainersSection from '../components/TrainersSection';

class trainersPage extends Component {
    render() {
        return (
            <Page>
                <h1 className="pageHeader">TRAINERS</h1>
                <TrainersSection/>

                <style jsx>{`
                    .trainersBar {
                        background-size: cover;
                    }

                    .pageHeader {
                        background-color: #e05275;
                        font-color: white;
                    }

                    .pageHeader h1 {
                        font-color: white;
                    }

                    .trainersBar h1 {
                        font-family: Helvetica;
                        font-weight: 900;
                        margin:0;
                        background-color: #e05275;
                        color: white;
                        font-size: 50px;
                        text-align: center;
                        padding-top: 10px;
                        padding-bottom: 20px;
                        vertical-align: middle;
                        font-size: 5vh;
                    }
                `}</style>
            </Page>
        );
    }
 }

export default trainersPage;
